import {Badge, ListGroup} from "react-bootstrap";

const OrderItem = ({order}) => {
    return (
        <div className="p-2 m-1 d-flex justify-content-between" style={{border:"solid 3px black"}}>

                <ListGroup >
                    <ListGroup.Item style={{width:500}} variant="primary">Primary</ListGroup.Item>

                </ListGroup>

        </div>
    );
};

